import axios from 'axios';
import { useEffect, useState } from 'react';


import Cohort_infoComponent from '../Details_Module/Cohort_infoComponent.js';



function CohortProjectLists(cohortListsProj) {

    const state={projName:null,cohortName:null}

    const onClickDisp = () => {
        this.setState({projName:cohortListsProj.projectName,cohortName:cohortListsProj.projectsList.cohortProjName.value}); 
           }; 


    return (
        <div className='cohortSubProjList_class' onClick={this.onClickDisp}>
            <span>&rarr;</span> {cohortListsProj.projectsList.cohortProjName.value}

            <Cohort_infoComponent projectInfoReq={this.state.projName} cohortInfoReq={this.state.cohortName}/>
        
        </div>
      );
}


export default CohortProjectLists;
